import React from 'react';
import classes from './NavContentSetting.module.css'
import {useSelector,useDispatch} from 'react-redux';
import {navSettingsStatus} from '../../store/navBarReducer'

const NavContentSetting = () => {
  const dispatch= useDispatch()
  const navSettingsStatus=useSelector((state)=>state.navStatus.NavContentSettingStatus)
  return (
    <div className={classes.navContent_wrapper} onClick={()=>{dispatch(navSettingsStatus(true))

    }}>
      123
    </div>

  );
};

export default NavContentSetting;
